import '../App.css';
import { github, linkedIn, gmail, fb } from '../assets/socials';
import '../App.js'

function SocialCard(props) {
    <a rel="noreferrer noopener" target="_blank" href={props.href}><img src={props.src}></img></a>
}

export function Header({scrollToSection, projectsRef, contactRef}) {
    const mySocials = [
        {
            key: 1,
            href: "https://github.com/",
            src:{github},
        },
    ]
    return (
        <div className="header">
            <div className="socials">
                {}
                <a rel="noreferrer noopener" target="_blank" href="https://github.com/"><img src={github} alt="github" /></a>
                <a rel="noreferrer noopener" target="_blank" href="https://www.linkedin.com/"><img src={linkedIn} alt="linkedin" /></a>
                <a rel="noreferrer noopener" target="_blank" href="https://gmail.com"><img src={gmail} alt="gmail" /></a>
                <a rel="noreferrer noopener" target="_blank" href="https://www.facebook.com/"><img src={fb} alt="facebook" /></a>
            </div>
            <div className="nav">
                <button onClick={() => scrollToSection(projectsRef)}>Projects</button>
                <button onClick={() => scrollToSection(contactRef)}>Contact Me</button>
            </div>
        </div>
    );
}
